import React from 'react';
import { css, keyframes } from 'emotion'
import { MDBView, MDBMask } from "mdbreact";
import { Link } from "react-router-dom";

import voluntering from '../../images/hackton.jpg'

const Voluntering = () => {
    return (
            <div className={styles.projects}>
                <MDBView hover zoom>
                    <img
                        className={styles.image}
                        src={voluntering}
                        alt=""
                    />
                    <MDBMask className={styles.classname} >
                        <div className={styles.summary}>
                            <p> Technical Volunter at <a href="https://codenation.org/" style={{color: "white", textDecoration: "underline", cursor: "pointer"}}>Code Nation</a> </p>
                        </div>
                    </MDBMask>
                </MDBView>
            </div>
    )
}

let classname = "flex-center";

const fadeInImage = keyframes` {
    0 % {
        width: 30 %;
        height: 30 %;
    } 
    100% {
        width: 100%;
         width: 100%;
        }
    }`

const styles = {
    projects: css`
        height: 350px;
        width: 320px;
        `,
    image: css`
        animation: ${fadeInImage} 0.3s ease-out;`,
    classname: css`
        color: white;
        font-size: 1.5em;
        font-weight: bold;
        text-align: center;
    `,
    summary: css`
        margin-top: 91%;
        width: auto;
        height: auto;
        background-color: #008080;
        font-size: 20px;
        `
}

export default Voluntering;
